import React from 'react';
import '../../App.css';
import { Link } from 'react-router-dom';
import { Box, TextField, Button } from '@mui/material';


function Registration() {

    return (
      <div className = "formulario">
      <br />
      <Box className ="wallPaperBox">
      <h2>Preencha os dados</h2>
        <Box className ="boxRegister" p={8} sx={{width: 700, maxWidth: '100%',}}>
         <TextField className = "textArea" fullWidth label="Nome" id="firstName" />
         <TextField className =  "textArea" fullWidth label="Sobrenome" id="fullWidth" />
         <TextField className = "textArea" fullWidth label="Nome da empresa" id="fullWidth" />
         <TextField className = "textArea" fullWidth label="Cargo" id="fullWidth" />
         <TextField className = "textArea" fullWidth label="E-mail corporativo" id="fullWidth" />
         <TextField className = "textArea" fullWidth label="Telefone" id="fullWidth" />
         <TextField className = "textArea" fullWidth label="Senha" id="fullWidth" /> 
         <TextField className = "textArea" fullWidth label="Confirmar senha" id="fullWidth" />
          <Link to="/version">
            <Button variant="contained" id = "buttonForm">Continuar</Button>
          </Link>
        </Box>
       </Box>
  </div>
    );
}

export default Registration;
